import React from "react";
import { ReactTyped } from "react-typed";

const Hero = () => {
  return (
    <div className="h-screen relative flex flex-col lg:flex-row items-start justify-start overflow-hidden">
      {/* Text Content */}
      <div className="text-2xl lg:text-5xl font-bold text-gray-800 z-10 p-6 w-full lg:w-1/2 lg:pl-0">
        <h1 className="md:text-7xl sm:text-6xl text-3xl p-2 font-bold animate-[fade-in_1s_ease-in-out_forwards]">
          Empowering Minds,
        </h1>
        <h1 className="text-teal-500 md:text-7xl sm:text-6xl text-3xl p-4 font-bold animate-[fade-in_1s_ease-in-out_forwards_0.2s]">
          Shaping Futures at
        </h1>
        <h1 className="md:text-7xl sm:text-6xl text-4xl p-2 font-bold animate-[fade-in_1s_ease-in-out_forwards_0.4s]">
          Tesla Academy.
        </h1>

        <div className="mt-4">
          <ReactTyped
            strings={['SCIENCE...', 'MATHEMATICS...', 'SOCIAL STUDIES...']}
            className="md:text-3xl sm:text-2xl text-2xl p-2 font-bold text-teal-500"
            typeSpeed={50}
            backSpeed={80}
            loop
          />
        </div>
      </div>

      {/* Featured Courses Section */}
      <div className="mt-10 px-6 lg:px-12 w-full">
        <h2 className="text-4xl font-bold text-gray-800 mb-6">
          Explore Our Popular Courses
        </h2>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {['Mathematics', 'Science', 'Social Studies'].map((course, index) => (
            <div
              key={index}
              className="border rounded-lg shadow-lg p-6 bg-white hover:shadow-xl transition-all duration-300"
            >
              <img
                src={`https://via.placeholder.com/400x200?text=${course}`}
                alt={course}
                className="rounded-md mb-4"
              />
              <h3 className="text-2xl font-bold text-gray-800 mb-2">{course}</h3>
              <p className="text-gray-600 mb-4">
                Master {course} with our expertly curated content and resources.
              </p>
              <button className="bg-teal-500 text-white px-4 py-2 rounded-lg font-bold hover:bg-teal-700 transition">
                Learn More
              </button>
            </div>
          ))}
        </div>
      </div>

      {/* Why Choose Us Section */}
      <div className="mt-16 px-6 lg:px-12">
        <h2 className="text-4xl font-bold text-gray-800 mb-6">Why Choose Tesla Academy?</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {[
            {
              title: 'Certified Courses',
              description: 'Get certified and boost your career with industry-recognized courses.',
            },
            {
              title: 'Self-Paced Learning',
              description: 'Learn at your own pace with flexible schedules and access anytime.',
            },
            {
              title: 'Expert Tutors',
              description: 'Learn from industry experts and experienced educators.',
            },
          ].map((feature, index) => (
            <div key={index} className="p-6 border rounded-lg shadow-lg bg-white hover:shadow-xl transition">
              <h3 className="text-2xl font-bold text-teal-500 mb-4">{feature.title}</h3>
              <p className="text-gray-600">{feature.description}</p>
            </div>
          ))}
        </div>
      </div>

      {/* Testimonials Section */}
      <div className="mt-16 px-6 lg:px-12">
        <h2 className="text-4xl font-bold text-gray-800 mb-6">What Our Students Say</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {[
            {
              name: 'John Doe',
              feedback: 'Tesla Academy transformed my learning journey. Highly recommended!',
            },
            {
              name: 'Jane Smith',
              feedback: 'The courses are amazing, and the flexibility is unmatched!',
            },
            {
              name: 'Mike Brown',
              feedback: 'Thanks to Tesla Academy, I excelled in my board exams!',
            },
          ].map((testimonial, index) => (
            <div
              key={index}
              className="p-6 border rounded-lg shadow-lg bg-white hover:shadow-xl transition"
            >
              <p className="italic text-gray-600">"{testimonial.feedback}"</p>
              <p className="font-bold text-gray-800 mt-4">- {testimonial.name}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Hero;
